import React, { Component } from 'react';
import '../Styles/Profile.css';
import Navigation from '../Components/Navigation';
import Universities from '../static_resources/universities.png';
import Footer from '../Components/Footer';

class UniversityProfile extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <p></p>
        <h1>University Name</h1>
        <img src={Universities} class="cover-image" />
        <p></p>
        <h4>Acceptance Rate: XX</h4>
        <h4>Most Popular Major: XX</h4>
        <h4>Public or Private: XX</h4>
        <h4>Tuition: XX</h4>
        <h4>Rural or Urban: XX</h4>
        <h4>Sports Division: XX</h4>
        <h4>Post Graduation Salary: XX</h4>
        <h4>Graduation Rate: XX</h4>
        <h4>Retention Rate: XX</h4>
        <h4>Student Faculty Ratio: XX</h4>
        <h4>Religious Affiliation: XX</h4>
        <h4>Demographics: XX</h4>
        <p></p>
        <Footer />
      </div>
    );
  }
}

export default UniversityProfile;
